description:
Made in the USA

Travel Documentary hosted by Jim Conrad, published by Smithsonian Channel broadcasted as part of Smithsonian Channel - Aerial America series in 2012 - English narration


Information
------------------------------

&quot;Made in the USA&quot; isn't just a label. It's a testament to American ingenuity and the pioneers and risk takers who have given us everything from jumbo jets to microchips, and ketchup to cornflakes. This cross-country journey celebrates the nation's crowning industrial achievements and the people behind them. Soar above Starbucks headquarters, Motown Records, Talladega Superspeedway, and more, exploring stories of inspiration, innovation, and invention.

